import './App.css';
import React from 'react'; //we should import jsx, react is library from node modules

const App = () => {
  return (
    <div className='app-wrapper'>
      <header className='header'>
        <img src="https://99designs-blog.imgix.net/blog/wp-content/uploads/2016/08/featured.png?auto=format&q=60&w=2060&h=1158.75&fit=crop&crop=faces" />
      </header>
      <nav className='nav'>
        <div>
          Profile
        </div>

        <div>Messages</div>
        <div>News</div>
        <div>Music</div>
      </nav>
      <div className='content'>Main content</div>
    </div>
  );
}

export default App;
